import React, { useRef, useEffect, useState } from "react";
import "./Booking.css";
import $ from 'jquery';
import axios from "axios";
import { DataTable } from 'datatables.net';
import 'datatables.net-bs4/js/dataTables.bootstrap4';

function UBookings() {
  const dataTableRef = useRef(null);
  const [bdata,setbdata]=useState([]);
  const [vchecker,setchecker]=useState(false);
  const [vchecker1,setchecker1]=useState(false);


    useEffect(()=>{
      axios.post('http://localhost:3001/ubooking',{
         uname:localStorage.getItem('username').toString()
      }).then((response)=>{
        if(response.data==="no"){
          setchecker1(true);
        }
        else{
        setbdata(response.data);
        setchecker(true);
        }
      });

      })

        useEffect(() => {
          if(vchecker){
          $(dataTableRef.current).DataTable();
          $('.dataTables_length').addClass('bs-select');
          }
        }, [vchecker]);
        useEffect(() => {
          if(vchecker1){
          $(dataTableRef.current).DataTable();
          $('.dataTables_length').addClass('bs-select');
          }
        }, [vchecker1]);

        const convertNumber = (number) => {
          return number === 1
            ? 10
            : number === 2
            ? 9
            : number === 3
            ? 8
            : number === 4
            ? 7
            : number === 5
            ? 6
            : number === 6
            ? 5
            : number === 7
            ? 4
            : number === 8
            ? 3
            : number === 9
            ? 2
            : number === 10
            ? 1
            : number;
        };

    return(
        <div className="uu">
        <div className="ubooking">
            <table ref={dataTableRef} id="dtBasicExample" class="table table-striped table-bordered table-sm" cellspacing="0" width="100%">
  <thead>
    <tr>
      <th class="th-sm">Centre Name
      </th>
      <th class="th-sm">Time of Vaccination
      </th>
      <th class="th-sm">Booking Date
      </th>
      <th class="th-sm">Aadhar Number
      </th>
      <th class="th-sm">Benificiary Name
      </th>
      <th class="th-sm">Benificiary Age
      </th>
      <th class="th-sm">Vaccine Name
      </th>
    </tr>
  </thead>
  <tbody>
    {
      vchecker&&bdata.map((data)=>{
        return(
          <tr>
            <td>{data.centre}</td>
            <td>{convertNumber(data.slot)}</td>
            <td>{data.booking_date}</td>
            <td>{data.aadhar}</td>
            <td>{data.bname}</td>
            <td>{data.bage}</td>
            <td>{data.vaccine}</td>
          </tr>
        );
      })
    }

  </tbody>
  <tfoot>
    <tr>
      <th>Centre Name
      </th>
      <th>Time of Vaccination
      </th>
      <th>Booking Date
      </th>
      <th>Aadhar Number
      </th>
      <th>Benificiary Name
      </th>
      <th>Benificiary Age
      </th>
      <th>Vaccine Name
      </th>
    </tr>
  </tfoot>
</table>
        </div>
        </div>
    )
};
export default UBookings;
